;; **
;;; Remove above 95% percentile for better comparison.
;; **

;; @@
(let [result (zipmap contacts  (map (fn [c] (remove #(> % 807) (nw-size c t0 tmax :distribution))) contacts))
       dat {:yvar (apply concat (vals result))
            :xvar (mapcat (fn [[k v]] (repeat (count v) (element-name k))) result)
            }]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :xvar :yvar {:fill :xvar}] ]
         [:geom_boxplot]
    	 [:stat_summary {:fun.y :mean, :geom "point" :shape 1 :size 2}]
         [:guides {:fill "none"}]
         [:xlab "Subclass"]
         [:ylab "Size"]
         [:theme_bw]
         [:ggtitle "Size hourly expansion"])]
      {:width 7 :height 6}))
