;; **
;;; ## Daily Expansion
;; **

;; @@
(defn plot-order-expansion [coll]
  (let [result (zipmap coll (map #(order % t0 tmax :evolution) coll))
       dat {:day (mapcat (comp range count) (vals result))
            :count (mapcat val result)
            :label(mapcat (fn [[k v]] (repeat (count v) (element-name k))) result) }]
  
  (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :day :count {:group :label :color :label}]]
         [:geom_line]
         [:geom_point]
         [:xlab "Day"]
         [:ylab "Delta Order"]
         [:theme_bw]
         [:ggtitle "Order daily expansion"])]
      {:width 7 :height 6})))
