;; **
;;; ## Time of day average expansion
;; **

;; @@
(defn plot-order-time-expansion [coll]
  (let [result (order coll t0 tmax :time)
       dat {:day (keys result)
            :count (map :mean (vals result))
            :semin (mapv #(- (:mean %) (:sd %)) (vals result))
            :semax  (mapv #(+ (:mean %) (:sd %)) (vals result))}]
(gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :day :count]]
         [:geom_errorbar [:aes {:ymin :semin :ymax :semax }] {:width 0.68}]
         [:geom_line]
         [:geom_point]
         [:xlab "Time"]
         [:ylab "Fraction"]
         [:theme_bw]
         [:ggtitle (str "Order time expansion " (element-name coll))])]
      {:width 7 :height 6})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;overall-network/plot-order-time-expansion</span>","value":"#'overall-network/plot-order-time-expansion"}
;; <=

;; @@
(for [n nodes]
  (plot-order-time-expansion n))
