(let [result (zipmap contacts  (map (fn [c] (remove #(> % 1600) (total-degree c t0 tmax :distribution))) contacts))
       dat {:yvar (apply concat (vals result))
            :xvar (mapcat (fn [[k v]] (repeat (count v) (element-name k))) result)
            }]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :xvar :yvar {:fill :xvar}] ]
         [:geom_boxplot]
    	 [:stat_summary {:fun.y :mean, :geom "point" :shape 1 :size 2 :colour "red"}]
         [:guides {:fill "none"}]
         [:xlab "Subclass"]
         [:ylab "Total degree"]
         [:theme_bw]
         [:ggtitle "Total degree hourly expansion"])]
      {:width 7 :height 7}))
